import React from "react";
import lisaProfilePic from "../assets/lisaProfilePic.jpg";

function Header() {
    return (
        <nav className="flex navbar shadow-md gap 10 bg-amber-200 justify-start items-center">
            <ul className="flex  p-5 gap-5  pr-10 font-bold items-center">
                <li className="pr-10 text-3xl font-black">VandyBox</li>
                <li className=""><a href="">Home</a></li>
                <li className=""><a href="">Favorites</a></li>
                <li className=""><a href="">Categories</a></li>
                <li className=""><a href="">Rankings</a></li>
                
                <li className="ml-auto"></li>
            </ul>
            <input type="text"className="bg-stone-10 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="John" required/>
            <a href=""><img src ={lisaProfilePic} className="object-cover rounded-full w-16 h-16 "/></a>
        </nav>
    )
}

export default Header
